import './App.css';
import HomePage from './components/homePage.component';
import Destinations from './components/destinations.component'
import {  BrowserRouter, Routes,Route} from "react-router-dom";
import MyPage from './components/myPage.component'
import Login from './components/login.component'
import Register from './components/register.component'
 import MyFlights from './components/myFlights'
//  import AuthService from './components/AuthService';
 import PrivateRoutes from './components/PrivateRoutes';
//  import IdContext from './components/IdContext';
 import React, { useState ,useNavigate} from 'react';
function App() {
  const [ setId] = useState(null);
  const navigate = useNavigate();

  const handleLogin = async (response) => {
    setId(response.id);
    navigate(`/api/v1/destination/${response.id}`);
  };
  return (
    <BrowserRouter>
    <Routes>

       <Route exact path="/" element={<HomePage />} />
       <Route path="/api/v1/destination" element={<Destinations />} />
       {/* <Route path="/login" element={<Login />} /> */}
       <Route path="/login" element={<Login onLogin={handleLogin} />} />
       <Route path="/register" element={<Register />} />

       <Route element={<PrivateRoutes/>}>
          <Route path="/api/v1/destination/:id" element={<MyPage />} /> 
        </Route>
       {/* <Route path="/api/v1/destination/:id" element={<MyPage />} /> */}
       {/* this needs to take an id the myFlights page */}
       <Route path="/myFlights" element={<MyFlights />} />
    </Routes>
  </BrowserRouter>
    // <Router>
    //    <HomePage />
    //    <Route path="/destinations" exact component={Destinations} />
    // </Router>

    // <div className="App">
    //   <header className="App-header">
    //     <img src={logo} className="App-logo" alt="logo" />
    //     <p>
    //       Edit <code>src/App.js</code> and save to reload.
    //     </p>
    //     <a
    //       className="App-link"
    //       href="https://reactjs.org"
    //       target="_blank"
    //       rel="noopener noreferrer"
    //     >
    //       Learn React
    //     </a>
    //   </header>
    // </div>
  );
}

export default App;
